import React, { Fragment } from 'react';
import styled from 'styled-components';

const RightContainer = styled.div`
  background: green;
  height: 400px;
  width: 400px;
  border-bottom: 40px solid transparent;
  border-left: 16px solid green;
`;

const RightSide = () => {
  return (
    <Fragment>
      <RightContainer>

      </RightContainer>
    </Fragment>
  );
}

export default RightSide;
